import Navigation from "./components/navi/Navigation";
import { BrowserRouter as Router } from "react-router-dom";
import Routing from "./components/navi/Routing";
import MemesContextProvider from "./context/MemesProvider";
import "./App.css";

function App() {
  return (
    <div className="App">
      <MemesContextProvider>
        <Router>
          <Navigation />
          <Routing />
        </Router>
      </MemesContextProvider>
    </div>
  );
}

export default App;
